INSERT INTO `components_entry_fields_page_fields` (`id`, `language`, `title`, `body`)
VALUES
	(1,2,'AGB','<p>ifindilu.com ist eine unabhängige Informationsplattform für den Tarif- und Preisvergleich nachstehend aufgelisteter Bereiche. ifindilu.com richtet sich an Nutzer, die sich im Internet über Produkte und Dienstleistungen informieren möchten.</p><p>Für die Vermittlung gelten zwischen dem Kunden und ifindilu.com die AGB der nachführend aufgeführten Bereiche. Für die Inanspruchnahme der vermittelten Leistungen auf ifindilu.com selbst gelten die jeweiligen Geschäftsbedingungen unserer Partner bzw. die Leistungserbringer, welche hier ebenfalls eingesehen werden können.</p><p>&nbsp;</p><h2>2. Verantwortlichkeit für Inhalte</h2><p>ifindilu.com ist nicht für die Inhalte der jeweiligen Bereiche verantwortlich, die von Seiten Dritter zur Verfügung gestellt werden. ifindilu.com ist daher für die Richtigkeit der fremden Inhalte und für die als Werbung/Anzeige gekennzeichneten Texte und Bilder nicht verantwortlich. Verantwortlich für den Inhalt der Werbung/Anzeige ist allein der jeweils am Ende der Werbung/Anzeige benannte Ersteller der Werbung/Anzeige. ifindilu.com übernimmt keine Gewähr für die Richtigkeit der dort gemachten Angaben. Werbung/Anzeigen stellen keine Empfehlung von ifindilu.com für einen Dritten oder dessen Leistungen dar. Eine inhaltliche Kontrolle der als Werbung/Anzeige gekennzeichneten Inhalte durch den Herausgeber findet nicht statt. Verstöße der Inhalte hinter den auf ifindilu.com aufgeführten Links oder der von Nutzern eingestellten Inhalte gegen geltendes Recht sind ifindilu.com nicht bekannt und werden bei entsprechender Benachrichtigung gelöscht. Der Herausgeber ist bemüht, offensichtlich verbotene Inhalte möglichst selbständig zu entfernen. Sollte Entsprechendes nicht geschehen sein, so wird der Herausgeber die verbotenen Inhalte nach Aufforderung schnellstmöglich entfernen.</p><p>&nbsp;</p><h2>3. Europäische Online-Streitbeilegungs-Plattform</h2><p>Nach der EU-Verordnung Nr. 524/2013 über die Online-Streitbeilegung in Verbraucherangelegenheiten werden seit dem 9. Januar 2016 Streitigkeiten zwischen Verbrauchern und Unternehmern im Zusammenhang von Online-Kaufverträgen oder Online-Dienstleistungsverträgen über eine Online-Plattform beigelegt. Diese Plattform wird durch die Europäische</p><p>Kommission über das Portal: <a href=\"https://ec.europa.eu/consumers/odr/main/index.cfm?event=main.home2.show&amp;lng=DE\">http://ec.europa.eu/consumers/odr/</a> bereitgestellt.<br>Wir weisen Sie darauf hin, dass wir nicht bereit und nicht verpflichtet sind, an einem Streitbeilegungsverfahren vor einer Verbraucherschlichtungsstelle teilzunehmen</p><p><a href=\"https://www.bundesjustizamt.de/DE/Themen/Buergerdienste/Verbraucherstreitbeilegung/Uebersicht.html\">siehe Bundesjustizamt</a><br>&nbsp;</p><h2>4. Rechtswahl und Gerichtsstand</h2><p>Es gilt das Recht der Bundesrepublik Deutschland. Sofern der Nutzer Kaufmann ist, ist Gerichtsstand Heilbronn.</p>'),
	(6,1,'Conditions','<p>ifindilu.com is an independent information platform for tariff and price comparison in the areas listed below. ifindilu.com is aimed at users who want to find out more about products and services on the Internet.</p><p>The terms and conditions of the areas listed below apply to the mediation between the customer and ifindilu.com. For the use of the mediated services on ifindilu.com itself, the respective terms and conditions of our partners or the service providers apply, which can also be viewed here.</p><h2>2. Responsibility for content</h2><p>ifindilu.com is not responsible for the content of the respective areas made available by third parties. ifindilu.com is therefore not responsible for the correctness of the third-party content and for the texts and images marked as advertising / advertisements. The advertiser named at the end of the advertisement / advertisement is solely responsible for the content of the advertisement / advertisement. ifindilu.com assumes no liability for the correctness of the information provided there. Advertisements / advertisements do not represent a recommendation by ifindilu.com for a third party or its services. The publisher does not check the content of the content marked as advertisement / advertisement. Violations of the content behind the on ifindilu. com or the content posted by users contrary to applicable law are not known to ifindilu.com and will be deleted upon notification. The publisher endeavors to remove obviously forbidden content as independently as possible. If this has not happened, the publisher will remove the prohibited content as soon as possible upon request.</p><h2>3. European online dispute resolution platform</h2><p>According to EU regulation No. 524/2013 on online dispute resolution in consumer matters, disputes between consumers and entrepreneurs in connection with online sales contracts or online service contracts have been settled via an online platform since January 9, 2016. This platform is provided by the European</p><p>Commission via the portal: <a href=\"https://ec.europa.eu/consumers/odr/main/index.cfm?event=main.home2.show&amp;lng=DE\">http://ec.europa.eu/consumers/odr/</a> .<br>We would like to point out that we are not willing and not obliged to take part in a dispute settlement procedure before a consumer arbitration board</p><p><a href=\"https://www.bundesjustizamt.de/DE/Themen/Buergerdienste/Verbraucherstreitbeilegung/Uebersicht.html\">see Federal Justice Office</a></p><h2>4. Choice of law and place of jurisdiction</h2><p>The law of the Federal Republic of Germany. If the user is a merchant, the place of jurisdiction is Heilbronn.</p>'),
	(9,2,'Impressum','<p>Angaben gemäß § 5 TMG</p><p>Kirill Kramer<br>Liebigstrase 15<br>74074 Heilbronn</p><p><strong>Vertreten durch:</strong><br>Daniel Kramer</p><p><strong>Kontakt:</strong><br><br>E-Mail: <a href=\"https://www.ifindilu.com/mailto:info@ifindilu.com\">info@ifindilu.com</a><br>&nbsp;</p><p><strong>Umsatzsteuer-ID: DE328373319</strong><br>Umsatzsteuer-Identifikationsnummer gemäß §27a Umsatzsteuergesetz:<br>&nbsp;</p><p><strong>Haftungsausschluss:</strong><br><br><strong>Haftung für Inhalte</strong><br><br>Die Inhalte unserer Seiten wurden mit größter Sorgfalt erstellt. Für die Richtigkeit, Vollständigkeit und Aktualität der Inhalte können wir jedoch keine Gewähr übernehmen. Als Diensteanbieter sind wir gemäß § 7 Abs.1 TMG für eigene Inhalte auf diesen Seiten nach den allgemeinen Gesetzen verantwortlich. Nach §§ 8 bis 10 TMG sind wir als Diensteanbieter jedoch nicht verpflichtet, übermittelte oder gespeicherte fremde Informationen zu überwachen oder nach Umständen zu forschen, die auf eine rechtswidrige Tätigkeit hinweisen. Verpflichtungen zur Entfernung oder Sperrung der Nutzung von Informationen nach den allgemeinen Gesetzen bleiben hiervon unberührt. Eine diesbezügliche Haftung ist jedoch erst ab dem Zeitpunkt der Kenntnis einer konkreten Rechtsverletzung möglich. Bei Bekanntwerden von entsprechenden Rechtsverletzungen werden wir diese Inhalte umgehend entfernen.<br><br><strong>Haftung für Links</strong><br><br>Unser Angebot enthält Links zu externen Webseiten Dritter, auf deren Inhalte wir keinen Einfluss haben. Deshalb können wir für diese fremden Inhalte auch keine Gewähr übernehmen. Für die Inhalte der verlinkten Seiten ist stets der jeweilige Anbieter oder Betreiber der Seiten verantwortlich. Die verlinkten Seiten wurden zum Zeitpunkt der Verlinkung auf mögliche Rechtsverstöße überprüft. Rechtswidrige Inhalte waren zum Zeitpunkt der Verlinkung nicht erkennbar. Eine permanente inhaltliche Kontrolle der verlinkten Seiten ist jedoch ohne konkrete Anhaltspunkte einer Rechtsverletzung nicht zumutbar. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Links umgehend entfernen.<br><br><strong>Urheberrecht</strong><br><br>Die durch die Seitenbetreiber erstellten Inhalte und Werke auf diesen Seiten unterliegen dem deutschen Urheberrecht. Die Vervielfältigung, Bearbeitung, Verbreitung und jede Art der Verwertung außerhalb der Grenzen des Urheberrechtes bedürfen der schriftlichen Zustimmung des jeweiligen Autors bzw. Erstellers. Downloads und Kopien dieser Seite sind nur für den privaten, nicht kommerziellen Gebrauch gestattet. Soweit die Inhalte auf dieser Seite nicht vom Betreiber erstellt wurden, werden die Urheberrechte Dritter beachtet. Insbesondere werden Inhalte Dritter als solche gekennzeichnet. Sollten Sie trotzdem auf eine Urheberrechtsverletzung aufmerksam werden, bitten wir um einen entsprechenden Hinweis. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Inhalte umgehend entfernen.<br><br><strong>Datenschutz</strong><br><br>Die Nutzung unserer Webseite ist in der Regel ohne Angabe personenbezogener Daten möglich. Soweit auf unseren Seiten personenbezogene Daten (beispielsweise Name, Anschrift oder eMail-Adressen) erhoben werden, erfolgt dies, soweit möglich, stets auf freiwilliger Basis. Diese Daten werden ohne Ihre ausdrückliche Zustimmung nicht an Dritte weitergegeben.<br>Wir weisen darauf hin, dass die Datenübertragung im Internet (z.B. bei der Kommunikation per E-Mail) Sicherheitslücken aufweisen kann. Ein lückenloser Schutz der Daten vor dem Zugriff durch Dritte ist nicht möglich.<br>Der Nutzung von im Rahmen der Impressumspflicht veröffentlichten Kontaktdaten durch Dritte zur Übersendung von nicht ausdrücklich angeforderter Werbung und Informationsmaterialien wird hiermit ausdrücklich widersprochen. Die Betreiber der Seiten behalten sich ausdrücklich rechtliche Schritte im Falle der unverlangten Zusendung von Werbeinformationen, etwa durch Spam-Mails, vor.<br><br><br><strong>Google Analytics</strong><br><br>Diese Website benutzt Google Analytics, einen Webanalysedienst der Google Inc. (\'\'Google\'\'). Google Analytics verwendet sog. \'\'Cookies\'\', Textdateien, die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie ermöglicht. Die durch den Cookie erzeugten Informationen über Ihre Benutzung dieser Website (einschließlich Ihrer IP-Adresse) wird an einen Server von Google in den USA übertragen und dort gespeichert. Google wird diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports über die Websiteaktivitäten für die Websitebetreiber zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen zu erbringen. Auch wird Google diese Informationen gegebenenfalls an Dritte übertragen, sofern dies gesetzlich vorgeschrieben oder soweit Dritte diese Daten im Auftrag von Google verarbeiten. Google wird in keinem Fall Ihre IP-Adresse mit anderen Daten der Google in Verbindung bringen. Sie können die Installation der Cookies durch eine entsprechende Einstellung Ihrer Browser Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht sämtliche Funktionen dieser Website voll umfänglich nutzen können. Durch die Nutzung dieser Website erklären Sie sich mit der Bearbeitung der über Sie erhobenen Daten durch Google in der zuvor beschriebenen Art und Weise und zu dem zuvor benannten Zweck einverstanden.<br><br><strong>Google AdSense</strong><br><br>Diese Website benutzt Google Adsense, einen Webanzeigendienst der Google Inc., USA (\'\'Google\'\'). Google Adsense verwendet sog. \'\'Cookies\'\' (Textdateien), die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie ermöglicht. Google Adsense verwendet auch sog. \'\'Web Beacons\'\' (kleine unsichtbare Grafiken) zur Sammlung von Informationen. Durch die Verwendung des Web Beacons können einfache Aktionen wie der Besucherverkehr auf der Webseite aufgezeichnet und gesammelt werden. Die durch den Cookie und/oder Web Beacon erzeugten Informationen über Ihre Benutzung dieser Website (einschließlich Ihrer IP-Adresse) werden an einen Server von Google in den USA übertragen und dort gespeichert. Google wird diese Informationen benutzen, um Ihre Nutzung der Website im Hinblick auf die Anzeigen auszuwerten, um Reports über die Websiteaktivitäten und Anzeigen für die Websitebetreiber zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen zu erbringen. Auch wird Google diese Informationen gegebenenfalls an Dritte übertragen, sofern dies gesetzlich vorgeschrieben oder soweit Dritte diese Daten im Auftrag von Google verarbeiten. Google wird in keinem Fall Ihre IP-Adresse mit anderen Daten der Google in Verbindung bringen. Das Speichern von Cookies auf Ihrer Festplatte und die Anzeige von Web Beacons können Sie verhindern, indem Sie in Ihren Browser-Einstellungen \'\'keine Cookies akzeptieren\'\' wählen (Im MS Internet-Explorer unter \'\'Extras &gt; Internetoptionen &gt; Datenschutz &gt; Einstellung\'\'; im Firefox unter \'\'Extras &gt; Einstellungen &gt; Datenschutz &gt; Cookies\'\'); wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht sämtliche Funktionen dieser Website voll umfänglich nutzen können. Durch die Nutzung dieser Website erklären Sie sich mit der Bearbeitung der über Sie erhobenen Daten durch Google in der zuvor beschriebenen Art und Weise und zu dem zuvor benannten Zweck einverstanden.</p>'),
	(11,2,'About Us (Old)','<figure class=\"image\"><img src=\"/uploads/logo_a913886b3d.png\" alt=\"\"><figcaption><strong>Ifindilu</strong></figcaption></figure><p>&nbsp;</p><p>&nbsp;</p><h3>Überblick</h3><p>iFINDilu ist eine Shopping- und Vergleichsplattform, die die Vision verfolgt, jedermann die Suche nach den besten Produkten zu vereinfachen.</p><p>&nbsp;</p><h3>Suchprozess</h3><ul><li>Wir suchen nach Produkten wie du es wahrscheinlich machen würdest.<ul><li>Dafür haben wir einen Algorithmus entwickelt, der diese Suche simuliert.</li><li>Um gleichzeitig den Überblick nicht zu verlieren, reduzieren wir mit unseren spezielle Prozess, deren Anzahl.</li></ul></li><li>Eigener Bewertungssystem: Aus diesen und andern Merkmalen wird unsere Bewertung gebildet, die auch über die Platzierung auf unserer Seite entscheidet.<ul><li>Wir schauen uns die Produkte an, analysieren deren Preis und schauen ob dieser ihrgen wo billiger ist.</li><li>Wir überprüfen die Qualität.</li><li>Wir schauen wie neu dieses Produkt ist.</li></ul></li><li>Wir erkennen Betrug, indem wir unter anderem jede Bewertung auf ihre Echtheit überprüfen.</li></ul><p>&nbsp;</p><h3><a href=\"https://ifindilu.com/de/offers\">Angebote</a></h3><p>Auf unsere Angebote sind wir besonders stolz, wir durchsuchen die größten Webseiten für Konsumprodukte wie Amazon, Ebay, Aliexpress und co, wählen die unserer Meinung nach besten Angebote, gleichzeitig halten wir unseren Suchprozess ein, um jeglichen Betrug und vermeintliche Schnäppchen zu unterbinden.</p><p>&nbsp;</p><h3><a href=\"https://ifindilu.com/de/productcomparison\">Produktvergleich</a></h3><p>Wir machen uns für dich die Mühe, nach Produkten zu suchen, wie es ein Experte tun würde, dafür nutzen wir den oben genanten Suchprozess.&nbsp;</p><p>&nbsp;</p><h3><a href=\"https://ifindilu.com/de/gifts\">Geschenkideen&nbsp;</a></h3><p>wer kennt es nicht jedes Jahr hat jemand Geburtstag :). Die Suche nach dem richtigen Geschenk ist öfters eine Herausforderung. Für die Jenigen die eine Muse benötigen, um das passende Geschenk zu finden, haben wir den Geschenkideen Bereich erstellt. Schau mal vorbei und finde, für dich, das passende Geschenk.</p><p>&nbsp;</p><h2>Idee</h2><p>Wie ist diese Idee entstanden?</p><p>Vielleicht kennst du die Situation, wenn ihr für jemanden aus der Familie, Bekannten oder Freunde ein Produkt aussuchen müsst, das gut und günstig ist. Dann sucht man lange im Internet und verschwendet seine Zeit.</p><p>Damit diese Zeit dir nicht Genomen wird, wurde am 20.02.2020 die Idee geboren das wir für dich die Produkte suchen, wie du sie suchen würdest.&nbsp;</p><p>Deswegen heißen wir [IFINDILU] = [I][F]ind[It][Like]yo[U]</p><p>Unsere Vision besteht darin, dir zu helfen, eine kleine optimierte Auswahl an den Produkten zu finden, sodass du das nächste Mal, wenn deine Freunde dich auf die Suche schicken, einfach diese Webseite schickst, um dir und den anderen die Zeit zu ersparen.</p><p>&nbsp;</p><p>Wir danke für deinen Besuch auf dieser Seite und wünschen dir einen schönen Tag :)</p>'),
	(12,2,'Datenschutzerklärung','<p>Wir freuen uns sehr über Ihr Interesse an unserem Unternehmen. Datenschutz hat einen besonders hohen Stellenwert für die Betreiber dieser Webseite. Eine Nutzung dieser Internetseiten ist grundsätzlich ohne jede Angabe personenbezogener Daten möglich. Sofern eine betroffene Person besondere Services unseres Unternehmens über unsere Internetseite in Anspruch nehmen möchte, könnte jedoch eine Verarbeitung personenbezogener Daten erforderlich werden. Ist die Verarbeitung personenbezogener Daten erforderlich und besteht für eine solche Verarbeitung keine gesetzliche Grundlage, holen wir generell eine Einwilligung der betroffenen Person ein.</p><p>Die Verarbeitung personenbezogener Daten, beispielsweise des Namens, der Anschrift, E-Mail-Adresse oder Telefonnummer einer betroffenen Person, erfolgt stets im Einklang mit der Datenschutz-Grundverordnung und in Übereinstimmung mit den für die Firma ifindilu.com geltenden landesspezifischen Datenschutzbestimmungen. Mittels dieser Datenschutzerklärung möchte unser Unternehmen die Öffentlichkeit über Art, Umfang und Zweck der von uns erhobenen, genutzten und verarbeiteten personenbezogenen Daten informieren. Ferner werden betroffene Personen mittels dieser Datenschutzerklärung über die ihnen zustehenden Rechte aufgeklärt.</p><p>Die Firma ifindilu.com hat als für die Verarbeitung Verantwortlicher zahlreiche technische und organisatorische Maßnahmen umgesetzt, um einen möglichst lückenlosen Schutz der über diese Internetseite verarbeiteten personenbezogenen Daten sicherzustellen. Dennoch können Internetbasierte Datenübertragungen grundsätzlich Sicherheitslücken aufweisen, sodass ein absoluter Schutz nicht gewährleistet werden kann. Aus diesem Grund steht es jeder betroffenen Person frei, personenbezogene Daten auch auf alternativen Wegen, beispielsweise telefonisch, an uns zu übermitteln.</p><h4>1. Begriffsbestimmungen</h4><p>Die Datenschutzerklärung der Firma ifindilu.com beruht auf den Begrifflichkeiten, die durch den Europäischen Richtlinien- und Verordnungsgeber beim Erlass der Datenschutz-Grundverordnung (DS-GVO) verwendet wurden. Unsere Datenschutzerklärung soll sowohl für die Öffentlichkeit als auch für unsere Kunden und Geschäftspartner einfach lesbar und verständlich sein. Um dies zu gewährleisten, möchten wir vorab die verwendeten Begrifflichkeiten erläutern.</p><p>Wir verwenden in dieser Datenschutzerklärung unter anderem die folgenden Begriffe:</p><h4>a) personenbezogene Daten</h4><p>Personenbezogene Daten sind alle Informationen, die sich auf eine identifizierte oder identifizierbare natürliche Person (im Folgenden „betroffene Person“) beziehen. Als identifizierbar wird eine natürliche Person angesehen, die direkt oder indirekt, insbesondere mittels Zuordnung zu einer Kennung wie einem Namen, zu einer Kennnummer, zu Standortdaten, zu einer Online-Kennung oder zu einem oder mehreren besonderen Merkmalen, die Ausdruck der physischen, physiologischen, genetischen, psychischen, wirtschaftlichen, kulturellen oder sozialen Identität dieser natürlichen Person sind, identifiziert werden kann.</p><h4>b) betroffene Person</h4><p>Betroffene Person ist jede identifizierte oder identifizierbare natürliche Person, deren personenbezogene Daten von dem für die Verarbeitung Verantwortlichen verarbeitet werden.</p><h4>c) Verarbeitung</h4><p>Verarbeitung ist jeder mit oder ohne Hilfe automatisierter Verfahren ausgeführte Vorgang oder jede solche Vorgangsreihe im Zusammenhang mit personenbezogenen Daten wie das Erheben, das Erfassen, die Organisation, das Ordnen, die Speicherung, die Anpassung oder Veränderung, das Auslesen, das Abfragen, die Verwendung, die Offenlegung durch Übermittlung, Verbreitung oder eine andere Form der Bereitstellung, den Abgleich oder die Verknüpfung, die Einschränkung, das Löschen oder die Vernichtung.</p><h4>d) Einschränkung der Verarbeitung</h4><p>Einschränkung der Verarbeitung ist die Markierung gespeicherter personenbezogener Daten mit dem Ziel, ihre künftige Verarbeitung einzuschränken.</p><h4>e) Profiling</h4><p>Profiling ist jede Art der automatisierten Verarbeitung personenbezogener Daten, die darin besteht, dass diese personenbezogenen Daten verwendet werden, um bestimmte persönliche Aspekte, die sich auf eine natürliche Person beziehen, zu bewerten, insbesondere, um Aspekte bezüglich Arbeitsleistung, wirtschaftlicher Lage, Gesundheit, persönlicher Vorlieben, Interessen, Zuverlässigkeit, Verhalten, Aufenthaltsort oder Ortswechsel dieser natürlichen Person zu analysieren oder vorherzusagen.</p><h4>f) Pseudonymisierung</h4><p>Pseudonymisierung ist die Verarbeitung personenbezogener Daten in einer Weise, auf welche die personenbezogenen Daten ohne Hinzuziehung zusätzlicher Informationen nicht mehr einer spezifischen betroffenen Person zugeordnet werden können, sofern diese zusätzlichen Informationen gesondert aufbewahrt werden und technischen und organisatorischen Maßnahmen unterliegen, die gewährleisten, dass die personenbezogenen Daten nicht einer identifizierten oder identifizierbaren natürlichen Person zugewiesen werden.</p><h4>g) Verantwortlicher oder für die Verarbeitung Verantwortlicher</h4><p>Verantwortlicher oder für die Verarbeitung Verantwortlicher ist die natürliche oder juristische Person, Behörde, Einrichtung oder andere Stelle, die allein oder gemeinsam mit anderen über die Zwecke und Mittel der Verarbeitung von personenbezogenen Daten entscheidet. Sind die Zwecke und Mittel dieser Verarbeitung durch das Unionsrecht oder das Recht der Mitgliedstaaten vorgegeben, so kann der Verantwortliche beziehungsweise können die bestimmten Kriterien seiner Benennung nach dem Unionsrecht oder dem Recht der Mitgliedstaaten vorgesehen werden.</p><h4>h) Auftragsverarbeiter</h4><p>Auftragsverarbeiter ist eine natürliche oder juristische Person, Behörde, Einrichtung oder andere Stelle, die personenbezogene Daten im Auftrag des Verantwortlichen verarbeitet.</p><h4>i) Empfänger</h4><p>Empfänger ist eine natürliche oder juristische Person, Behörde, Einrichtung oder andere Stelle, der personenbezogene Daten offengelegt werden, unabhängig davon, ob es sich bei ihr um einen Dritten handelt oder nicht. Behörden, die im Rahmen eines bestimmten Untersuchungsauftrags nach dem Unionsrecht oder dem Recht der Mitgliedstaaten möglicherweise personenbezogene Daten erhalten, gelten jedoch nicht als Empfänger.</p><h4>j) Dritter</h4><p>Dritter ist eine natürliche oder juristische Person, Behörde, Einrichtung oder andere Stelle außer der betroffenen Person, dem Verantwortlichen, dem Auftragsverarbeiter und den Personen, die unter der unmittelbaren Verantwortung des Verantwortlichen oder des Auftragsverarbeiters befugt sind, die personenbezogenen Daten zu verarbeiten.</p><h4>k) Einwilligung</h4><p>Einwilligung ist jede von der betroffenen Person freiwillig für den bestimmten Fall in informierter Weise und unmissverständlich abgegebene Willensbekundung in Form einer Erklärung oder einer sonstigen eindeutigen bestätigenden Handlung, mit der die betroffene Person zu verstehen gibt, dass sie mit der Verarbeitung der sie betreffenden personenbezogenen Daten einverstanden ist.</p><h4>2. Name und Anschrift des für die Verarbeitung Verantwortlichen</h4><p>Verantwortlicher im Sinne der Datenschutz-Grundverordnung, sonstiger in den Mitgliedstaaten der Europäischen Union geltenden Datenschutzgesetze und anderer Bestimmungen mit datenschutzrechtlichem Charakter ist die:</p><p>Kirill Kramer</p><p>Liebigstraße 15</p><p>74074 Heilbronn</p><p>Deutschland</p><p>E-Mail: <a href=\"https://www.ifindilu.com/mailto:info@ifindilu.com\">info@ifindilu.com</a></p><p>Website: www.ifindilu.com</p><h4>3. Cookies</h4><p>Die Internetseiten der Firma ifindilu.com verwenden Cookies. Cookies sind Textdateien, welche über einen Internetbrowser auf einem Computersystem abgelegt und gespeichert werden.</p><p>Zahlreiche Internetseiten und Server verwenden Cookies. Viele Cookies enthalten eine sogenannte Cookie-ID. Eine Cookie-ID ist eine eindeutige Kennung des Cookies. Sie besteht aus einer Zeichenfolge, durch welche Internetseiten und Server dem konkreten Internetbrowser zugeordnet werden können, in dem das Cookie gespeichert wurde. Dies ermöglicht es den besuchten Internetseiten und Servern, den individuellen Browser der betroffenen Person von anderen Internetbrowsern, die andere Cookies enthalten, zu unterscheiden. Ein bestimmter Internetbrowser kann über die eindeutige Cookie-ID wiedererkannt und identifiziert werden.</p><p>Durch den Einsatz von Cookies kann die Firma ifindilu.com den Nutzern dieser Internetseite nutzerfreundlichere Services bereitstellen, die ohne die Cookie-Setzung nicht möglich wären.</p><p>Mittels eines Cookies können die Informationen und Angebote auf unserer Internetseite im Sinne des Benutzers optimiert werden. Cookies ermöglichen uns, wie bereits erwähnt, die Benutzer unserer Internetseite wiederzuerkennen. Zweck dieser Wiedererkennung ist es, den Nutzern die Verwendung unserer Internetseite zu erleichtern. Der Benutzer einer Internetseite, die Cookies verwendet, muss beispielsweise nicht bei jedem Besuch der Internetseite erneut seine Zugangsdaten eingeben, weil dies von der Internetseite und dem auf dem Computersystem des Benutzers abgelegten Cookie übernommen wird. Ein weiteres Beispiel ist das Cookie eines Warenkorbes im Online-Shop. Der Online-Shop merkt sich die Artikel, die ein Kunde in den virtuellen Warenkorb gelegt hat, über ein Cookie.</p><p>Die betroffene Person kann die Setzung von Cookies durch unsere Internetseite jederzeit mittels einer entsprechenden Einstellung des genutzten Internetbrowsers verhindern und damit der Setzung von Cookies dauerhaft widersprechen. Ferner können bereits gesetzte Cookies jederzeit über einen Internetbrowser oder andere Softwareprogramme gelöscht werden. Dies ist in allen gängigen Internetbrowsern möglich. Deaktiviert die betroffene Person die Setzung von Cookies in dem genutzten Internetbrowser, sind unter Umständen nicht alle Funktionen unserer Internetseite vollumfänglich nutzbar.</p><h4>4. Erfassung von allgemeinen Daten und Informationen</h4><p>Die Internetseite der Firma ifindilu.com erfasst mit jedem Aufruf der Internetseite durch eine betroffene Person oder ein automatisiertes System eine Reihe von allgemeinen Daten und Informationen. Diese allgemeinen Daten und Informationen werden in den Logfiles des Servers gespeichert. Erfasst werden können die (1) verwendeten Browsertypen und Versionen, (2) das vom zugreifenden System verwendete Betriebssystem, (3) die Internetseite, von welcher ein zugreifendes System auf unsere Internetseite gelangt (sogenannte Referrer), (4) die Unterwebseiten, welche über ein zugreifendes System auf unserer Internetseite angesteuert werden, (5) das Datum und die Uhrzeit eines Zugriffs auf die Internetseite, (6) eine Internet-Protokoll-Adresse (IP-Adresse), (7) der Internet-Service-Provider des zugreifenden Systems und (8) sonstige ähnliche Daten und Informationen, die der Gefahrenabwehr im Falle von Angriffen auf unsere informationstechnologischen Systeme dienen.</p><p>Bei der Nutzung dieser allgemeinen Daten und Informationen zieht die Firma ifindilu.com keine Rückschlüsse auf die betroffene Person. Diese Informationen werden vielmehr benötigt, um (1) die Inhalte unserer Internetseite korrekt auszuliefern, (2) die Inhalte unserer Internetseite sowie die Werbung für diese zu optimieren, (3) die dauerhafte Funktionsfähigkeit unserer informationstechnologischen Systeme und der Technik unserer Internetseite zu gewährleisten sowie (4) um Strafverfolgungsbehörden im Falle eines Cyberangriffes die zur Strafverfolgung notwendigen Informationen bereitzustellen. Diese anonym erhobenen Daten und Informationen werden durch die Firma ifindilu.com daher einerseits statistisch und ferner mit dem Ziel ausgewertet, den Datenschutz und die Datensicherheit in unserem Unternehmen zu erhöhen, um letztlich ein optimales Schutzniveau für die von uns verarbeiteten personenbezogenen Daten sicherzustellen. Die anonymen Daten der Server-Logfiles werden getrennt von allen durch eine betroffene Person angegebenen personenbezogenen Daten gespeichert.</p><h4>5. Routinemäßige Löschung und Sperrung von personenbezogenen Daten</h4><p>Der für die Verarbeitung Verantwortliche verarbeitet und speichert personenbezogene Daten der betroffenen Person nur für den Zeitraum, der zur Erreichung des Speicherungszwecks erforderlich ist oder sofern dies durch den Europäischen Richtlinien- und Verordnungsgeber oder einen anderen Gesetzgeber in Gesetzen oder Vorschriften, welchen der für die Verarbeitung Verantwortliche unterliegt, vorgesehen wurde.</p><p>Entfällt der Speicherungszweck oder läuft eine vom Europäischen Richtlinien- und Verordnungsgeber oder einem anderen zuständigen Gesetzgeber vorgeschriebene Speicherfrist ab, werden die personenbezogenen Daten routinemäßig und entsprechend den gesetzlichen Vorschriften gesperrt oder gelöscht.</p><h4>6. Rechte der betroffenen Person</h4><h4>a) Recht auf Bestätigung</h4><p>Jede betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber eingeräumte Recht, von dem für die Verarbeitung Verantwortlichen eine Bestätigung darüber zu verlangen, ob sie betreffende personenbezogene Daten verarbeitet werden. Möchte eine betroffene Person dieses Bestätigungsrecht in Anspruch nehmen, kann sie sich hierzu jederzeit an einen Mitarbeiter des für die Verarbeitung Verantwortlichen wenden.</p><h4>b) Recht auf Auskunft</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, jederzeit von dem für die Verarbeitung Verantwortlichen unentgeltliche Auskunft über die zu seiner Person gespeicherten personenbezogenen Daten und eine Kopie dieser Auskunft zu erhalten. Ferner hat der Europäische Richtlinien- und Verordnungsgeber der betroffenen Person Auskunft über folgende Informationen zugestanden:</p><ul><li>die Verarbeitungszwecke</li><li>die Kategorien personenbezogener Daten, die verarbeitet werden</li><li>die Empfänger oder Kategorien von Empfängern, gegenüber denen die personenbezogenen Daten offengelegt worden sind oder noch offengelegt werden, insbesondere bei Empfängern in Drittländern oder bei internationalen Organisationen</li><li>falls möglich die geplante Dauer, für die die personenbezogenen Daten gespeichert werden, oder, falls dies nicht möglich ist, die Kriterien für die Festlegung dieser Dauer</li><li>das Bestehen eines Rechts auf Berichtigung oder Löschung der sie betreffenden personenbezogenen Daten oder auf Einschränkung der Verarbeitung durch den Verantwortlichen oder eines Widerspruchsrechts gegen diese Verarbeitung</li><li>das Bestehen eines Beschwerderechts bei einer Aufsichtsbehörde</li><li>wenn die personenbezogenen Daten nicht bei der betroffenen Person erhoben werden: Alle verfügbaren Informationen über die Herkunft der Daten</li><li>das Bestehen einer automatisierten Entscheidungsfindung einschließlich Profiling gemäß Artikel 22 Abs.1 und 4 DS-GVO und — zumindest in diesen Fällen — aussagekräftige Informationen über die involvierte Logik sowie die Tragweite und die angestrebten Auswirkungen einer derartigen Verarbeitung für die betroffene Person</li></ul><h4>c) Recht auf Berichtigung</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, die unverzügliche Berichtigung sie betreffender unrichtiger personenbezogener Daten zu verlangen. Ferner steht der betroffenen Person das Recht zu, unter Berücksichtigung der Zwecke der Verarbeitung, die Vervollständigung unvollständiger personenbezogener Daten — auch mittels einer ergänzenden Erklärung — zu verlangen.</p><p>Möchte eine betroffene Person dieses Berichtigungsrecht in Anspruch nehmen, kann sie sich hierzu jederzeit an einen Mitarbeiter des für die Verarbeitung Verantwortlichen wenden.</p><h4>d) Recht auf Löschung (Recht auf Vergessen werden)</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, von dem Verantwortlichen zu verlangen, dass die sie betreffenden personenbezogenen Daten unverzüglich gelöscht werden, sofern einer der folgenden Gründe zutrifft und soweit die Verarbeitung nicht erforderlich ist:</p><ul><li>Die personenbezogenen Daten wurden für solche Zwecke erhoben oder auf sonstige Weise verarbeitet, für welche sie nicht mehr notwendig sind.</li><li>Die betroffene Person widerruft ihre Einwilligung, auf die sich die Verarbeitung gemäß Art. 6 Abs. 1 Buchstabe a DS-GVO oder Art. 9 Abs. 2 Buchstabe a DS-GVO stützte, und es fehlt an einer anderweitigen Rechtsgrundlage für die Verarbeitung.</li><li>Die betroffene Person legt gemäß Art. 21 Abs. 1 DS-GVO Widerspruch gegen die Verarbeitung ein, und es liegen keine vorrangigen berechtigten Gründe für die Verarbeitung vor, oder die betroffene Person legt gemäß Art. 21 Abs. 2 DS-GVO Widerspruch gegen die Verarbeitung ein.</li><li>Die personenbezogenen Daten wurden unrechtmäßig verarbeitet.</li><li>Die Löschung der personenbezogenen Daten ist zur Erfüllung einer rechtlichen Verpflichtung nach dem Unionsrecht oder dem Recht der Mitgliedstaaten erforderlich, dem der Verantwortliche unterliegt.</li><li>Die personenbezogenen Daten wurden in Bezug auf angebotene Dienste der Informationsgesellschaft gemäß Art. 8 Abs. 1 DS-GVO erhoben.</li></ul><h4>e) Recht auf Einschränkung der Verarbeitung</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, von dem Verantwortlichen die Einschränkung der Verarbeitung zu verlangen, wenn eine der folgenden Voraussetzungen gegeben ist:</p><ul><li>Die Richtigkeit der personenbezogenen Daten wird von der betroffenen Person bestritten, und zwar für eine Dauer, die es dem Verantwortlichen ermöglicht, die Richtigkeit der personenbezogenen Daten zu überprüfen.</li><li>Die Verarbeitung ist unrechtmäßig, die betroffene Person lehnt die Löschung der personenbezogenen Daten ab und verlangt stattdessen die Einschränkung der Nutzung der personenbezogenen Daten.</li><li>Der Verantwortliche benötigt die personenbezogenen Daten für die Zwecke der Verarbeitung nicht länger, die betroffene Person benötigt sie jedoch zur Geltendmachung, Ausübung oder Verteidigung von Rechtsansprüchen.</li><li>Die betroffene Person hat Widerspruch gegen die Verarbeitung gem. Art. 21 Abs. 1 DS-GVO eingelegt und es steht noch nicht fest, ob die berechtigten Gründe des Verantwortlichen gegenüber denen der betroffenen Person überwiegen.</li></ul><h4>f) Recht auf Datenübertragbarkeit</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, die sie betreffenden personenbezogenen Daten, welche durch die betroffene Person einem Verantwortlichen bereitgestellt wurden, in einem strukturierten, gängigen und maschinenlesbaren Format zu erhalten. Sie hat außerdem das Recht, diese Daten einem anderen Verantwortlichen ohne Behinderung durch den Verantwortlichen, dem die personenbezogenen Daten bereitgestellt wurden, zu übermitteln, sofern die Verarbeitung auf der Einwilligung gemäß Art. 6 Abs. 1 Buchstabe a DS-GVO oder Art. 9 Abs. 2 Buchstabe a DS-GVO oder auf einem Vertrag gemäß Art. 6 Abs. 1 Buchstabe b DS-GVO beruht und die Verarbeitung mithilfe automatisierter Verfahren erfolgt, sofern die Verarbeitung nicht für die Wahrnehmung einer Aufgabe erforderlich ist, die im öffentlichen Interesse liegt oder in Ausübung öffentlicher Gewalt erfolgt, welche dem Verantwortlichen übertragen wurde.</p><p>Ferner hat die betroffene Person bei der Ausübung ihres Rechts auf Datenübertragbarkeit gemäß Art. 20 Abs. 1 DS-GVO das Recht, zu erwirken, dass die personenbezogenen Daten direkt von einem Verantwortlichen an einen anderen Verantwortlichen übermittelt werden, soweit dies technisch machbar ist und sofern hiervon nicht die Rechte und Freiheiten anderer Personen beeinträchtigt werden.</p><p>Zur Geltendmachung des Rechts auf Datenübertragbarkeit kann sich die betroffene Person jederzeit an einen Mitarbeiter der Firma ifindilu.com wenden.</p><h4>g) Recht auf Widerspruch</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, aus Gründen, die sich aus ihrer besonderen Situation ergeben, jederzeit gegen die Verarbeitung sie betreffender personenbezogener Daten, die aufgrund von Art. 6 Abs. 1 Buchstaben e oder f DS-GVO erfolgt, Widerspruch einzulegen. Dies gilt auch für ein auf diese Bestimmungen gestütztes Profiling.</p><p>Die Firma ifindilu.com verarbeitet die personenbezogenen Daten im Falle des Widerspruchs nicht mehr, es sei denn, wir können zwingende schutzwürdige Gründe für die Verarbeitung nachweisen, die den Interessen, Rechten und Freiheiten der betroffenen Person überwiegen, oder die Verarbeitung dient der Geltendmachung, Ausübung oder Verteidigung von Rechtsansprüchen.</p><p>Verarbeitet die Firma ifindilu.com personenbezogene Daten, um Direktwerbung zu betreiben, so hat die betroffene Person das Recht, jederzeit Widerspruch gegen die Verarbeitung der personenbezogenen Daten zum Zwecke derartiger Werbung einzulegen. Dies gilt auch für das Profiling, soweit es mit solcher Direktwerbung in Verbindung steht. Widerspricht die betroffene Person gegenüber der Firma ifindilu.com der Verarbeitung für Zwecke der Direktwerbung, so wird die Firma ifindilu.com die personenbezogenen Daten nicht mehr für diese Zwecke verarbeiten.</p><p>Zudem hat die betroffene Person das Recht, aus Gründen, die sich aus ihrer besonderen Situation ergeben, gegen die sie betreffende Verarbeitung personenbezogener Daten, die bei der Firma ifindilu.com zu wissenschaftlichen oder historischen Forschungszwecken oder zu statistischen Zwecken gemäß Art. 89 Abs. 1 DS-GVO erfolgen, Widerspruch einzulegen, es sei denn, eine solche Verarbeitung ist zur Erfüllung einer im öffentlichen Interesse liegenden Aufgabe erforderlich.</p><p>Zur Ausübung des Rechts auf Widerspruch kann sich die betroffene Person direkt an jeden Mitarbeiter der Firma ifindilu.com oder einen anderen Mitarbeiter wenden. Der betroffenen Person steht es ferner frei, im Zusammenhang mit der Nutzung von Diensten der Informationsgesellschaft, ungeachtet der Richtlinie 2002/58/EG, ihr Widerspruchsrecht mittels automatisierter Verfahren auszuüben, bei denen technische Spezifikationen verwendet werden.</p><h4>h) Automatisierte Entscheidungen im Einzelfall einschließlich Profiling</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, nicht einer ausschließlich auf einer automatisierten Verarbeitung — einschließlich Profiling — beruhenden Entscheidung unterworfen zu werden, die ihr gegenüber rechtliche Wirkung entfaltet oder sie in ähnlicher Weise erheblich beeinträchtigt, sofern die Entscheidung (1) nicht für den Abschluss oder die Erfüllung eines Vertrags zwischen der betroffenen Person und dem Verantwortlichen erforderlich ist, oder (2) aufgrund von Rechtsvorschriften der Union oder der Mitgliedstaaten, denen der Verantwortliche unterliegt, zulässig ist und diese Rechtsvorschriften angemessene Maßnahmen zur Wahrung der Rechte und Freiheiten sowie der berechtigten Interessen der betroffenen Person enthalten oder (3) mit ausdrücklicher Einwilligung der betroffenen Person erfolgt.</p><p>Ist die Entscheidung (1) für den Abschluss oder die Erfüllung eines Vertrags zwischen der betroffenen Person und dem Verantwortlichen erforderlich oder (2) erfolgt sie mit ausdrücklicher Einwilligung der betroffenen Person, trifft die Firma ifindilu.com angemessene Maßnahmen, um die Rechte und Freiheiten sowie die berechtigten Interessen der betroffenen Person zu wahren, wozu mindestens das Recht auf Erwirkung des Eingreifens einer Person seitens des Verantwortlichen, auf Darlegung des eigenen Standpunkts und auf Anfechtung der Entscheidung gehört.</p><p>Möchte die betroffene Person Rechte mit Bezug auf automatisierte Entscheidungen geltend machen, kann sie sich hierzu jederzeit an einen Mitarbeiter des für die Verarbeitung Verantwortlichen wenden.</p><h4>i) Recht auf Widerruf einer datenschutzrechtlichen Einwilligung</h4><p>Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europäischen Richtlinien- und Verordnungsgeber gewährte Recht, eine Einwilligung zur Verarbeitung personenbezogener Daten jederzeit zu widerrufen.</p><p>Möchte die betroffene Person ihr Recht auf Widerruf einer Einwilligung geltend machen, kann sie sich hierzu jederzeit an einen Mitarbeiter des für die Verarbeitung Verantwortlichen wenden.</p><h4>7. Datenschutzbestimmungen zu Einsatz und Verwendung von affilinet</h4><p>Der für die Verarbeitung Verantwortliche hat auf dieser Internetseite Komponenten des Unternehmens affilinet integriert. Affilinet ist ein deutsches Affiliate-Netzwerk, welches Affiliate-Marketing anbietet.</p><p>Affiliate-Marketing ist eine Internetgestützte Vertriebsform, die es kommerziellen Betreibern von Internetseiten, den sogenannten Merchants oder Advertisern, ermöglicht, Werbung, die meist über Klick- oder Sale-Provisionen vergütet wird, auf Internetseiten Dritter, also bei Vertriebspartnern, die auch Affiliates oder Publisher genannt werden, einzublenden. Der Merchant stellt über das Affiliate-Netzwerk ein Werbemittel, also einen Werbebanner oder andere geeignete Mittel der Internetwerbung, zur Verfügung, welche in der Folge von einem Affiliate auf eigenen Internetseiten eingebunden oder über sonstige Kanäle, wie etwa das Keyword-Advertising oder E-Mail-Marketing, beworben werden.</p><p>Betreibergesellschaft von Affilinet ist die affilinet GmbH, Sapporobogen 6-8, 80637 München, Germany.</p><p>Affilinet setzt ein Cookie auf dem informationstechnologischen System der betroffenen Person. Was Cookies sind, wurde oben bereits erläutert. Das Tracking-Cookie von Affilinet speichert keinerlei personenbezogene Daten. Gespeichert werden lediglich die Identifikationsnummer des Affiliate, also des den potentiellen Kunden vermittelnden Partners, sowie die Ordnungsnummer des Besuchers einer Internetseite und des angeklickten Werbemittels. Zweck der Speicherung dieser Daten ist die Abwicklung von Provisionszahlungen zwischen einem Merchant und dem Affiliate, welche über das Affiliate-Netzwerk, also Affilinet, abgewickelt werden.</p><p>Die betroffene Person kann die Setzung von Cookies durch unsere Internetseite, wie oben bereits dargestellt, jederzeit mittels einer entsprechenden Einstellung des genutzten Internetbrowsers verhindern und damit der Setzung von Cookies dauerhaft widersprechen. Eine solche Einstellung des genutzten Internetbrowsers würde auch verhindern, dass Affilinet ein Cookie auf dem informationstechnologischen System der betroffenen Person setzt. Zudem können von Affilinet bereits gesetzte Cookies jederzeit über einen Internetbrowser oder andere Softwareprogramme gelöscht werden.</p><p>Die geltenden Datenschutzbestimmungen von Affilinet können unter https://www.affili.net/de/footeritem/datenschutz abgerufen werden.</p><h4>8. Datenschutzbestimmungen zu Einsatz und Verwendung von Funktionen des Amazon-Partnerprogramms</h4><p>Der für die Verarbeitung Verantwortliche hat als Teilnehmer des Amazon-Partnerprogramms auf dieser Internetseite Amazon-Komponenten integriert. Die Amazon-Komponenten wurden von Amazon mit dem Ziel konzipiert, Kunden über Werbeanzeigen auf unterschiedliche Internetseiten der Amazon-Gruppe, insbesondere auf Amazon.co.uk, Local.Amazon.co.uk, Amazon.de, BuyVIP.com, Amazon.fr, Amazon.it und Amazon.es. BuyVIP.com gegen Zahlung einer Provision zu vermitteln. Der für die Verarbeitung Verantwortliche kann durch die Nutzung der Amazon-Komponenten Werbeeinnahmen generieren.</p><p>Betreibergesellschaft dieser Amazon-Komponenten ist die Amazon EU S.à.r.l, 5 Rue Plaetis, L-2338 Luxembourg, Luxemburg.</p><p>Amazon setzt ein Cookie auf dem informationstechnologischen System der betroffenen Person. Was Cookies sind, wurde oben bereits erläutert. Durch jeden einzelnen Aufruf einer der Einzelseiten dieser Internetseite, die durch den für die Verarbeitung Verantwortlichen betrieben wird und auf welcher eine Amazon-Komponente integriert wurde, wird der Internetbrowser auf dem informationstechnologischen System der betroffenen Person automatisch durch die jeweilige Amazon-Komponente veranlasst, Daten zum Zwecke der Online-Werbung und der Abrechnung von Provisionen an Amazon zu übermitteln. Im Rahmen dieses technischen Verfahrens erhält Amazon Kenntnis über personenbezogene Daten, die Amazon dazu dienen, die Herkunft von bei Amazon eingehenden Bestellungen nachzuvollziehen und in der Folge eine Provisionsabrechnung zu ermöglichen. Amazon kann unter anderem nachvollziehen, dass die betroffene Person einen Partnerlink auf unserer Internetseite angeklickt hat.</p><p>Die betroffene Person kann die Setzung von Cookies durch unsere Internetseite, wie oben bereits dargestellt, jederzeit mittels einer entsprechenden Einstellung des genutzten Internetbrowsers verhindern und damit der Setzung von Cookies dauerhaft widersprechen. Eine solche Einstellung des genutzten Internetbrowsers würde auch verhindern, dass Amazon ein Cookie auf dem informationstechnologischen System der betroffenen Person setzt. Zudem können von Amazon bereits gesetzte Cookies jederzeit über einen Internetbrowser oder andere Softwareprogramme gelöscht werden.</p><p>Weitere Informationen und die geltenden Datenschutzbestimmungen von Amazon können unter https://www.amazon.de/gp/help/customer/display.html?nodeId=3312401 abgerufen werden.</p><h4>9. Rechtsgrundlage der Verarbeitung</h4><p>Art. 6 I lit. a DS-GVO dient unserem Unternehmen als Rechtsgrundlage für Verarbeitungsvorgänge, bei denen wir eine Einwilligung für einen bestimmten Verarbeitungszweck einholen. Ist die Verarbeitung personenbezogener Daten zur Erfüllung eines Vertrags, dessen Vertragspartei die betroffene Person ist, erforderlich, wie dies beispielsweise bei Verarbeitungsvorgängen der Fall ist, die für eine Lieferung von Waren oder die Erbringung einer sonstigen Leistung oder Gegenleistung notwendig sind, so beruht die Verarbeitung auf Art. 6 I lit. b DS-GVO. Gleiches gilt für solche Verarbeitungsvorgänge die zur Durchführung vorvertraglicher Maßnahmen erforderlich sind, etwa in Fällen von Anfragen zur unseren Produkten oder Leistungen. Unterliegt unser Unternehmen einer rechtlichen Verpflichtung durch welche eine Verarbeitung von personenbezogenen Daten erforderlich wird, wie beispielsweise zur Erfüllung steuerlicher Pflichten, so basiert die Verarbeitung auf Art. 6 I lit. c DS-GVO. In seltenen Fällen könnte die Verarbeitung von personenbezogenen Daten erforderlich werden, um lebenswichtige Interessen der betroffenen Person oder einer anderen natürlichen Person zu schützen. Dies wäre beispielsweise der Fall, wenn ein Besucher in unserem Betrieb verletzt werden würde und daraufhin sein Name, sein Alter, seine Krankenkassendaten oder sonstige lebenswichtige Informationen an einen Arzt, ein Krankenhaus oder sonstige Dritte weitergegeben werden müssten. Dann würde die Verarbeitung auf Art. 6 I lit. d DS-GVO beruhen. Letztlich könnten Verarbeitungsvorgänge auf Art. 6 I lit. f DS-GVO beruhen. Auf dieser Rechtsgrundlage basieren Verarbeitungsvorgänge, die von keiner der vorgenannten Rechtsgrundlagen erfasst werden, wenn die Verarbeitung zur Wahrung eines berechtigten Interesses unseres Unternehmens oder eines Dritten erforderlich ist, sofern die Interessen, Grundrechte und Grundfreiheiten des Betroffenen nicht überwiegen. Solche Verarbeitungsvorgänge sind uns insbesondere deshalb gestattet, weil sie durch den Europäischen Gesetzgeber besonders erwähnt wurden. Er vertrat insoweit die Auffassung, dass ein berechtigtes Interesse anzunehmen sein könnte, wenn die betroffene Person ein Kunde des Verantwortlichen ist (Erwägungsgrund 47 Satz 2 DS-GVO).</p><h4>10. Berechtigte Interessen an der Verarbeitung, die von dem Verantwortlichen oder einem Dritten verfolgt werden</h4><p>Basiert die Verarbeitung personenbezogener Daten auf Artikel 6 I lit. f DS-GVO ist unser berechtigtes Interesse die Durchführung unserer Geschäftstätigkeit zugunsten des Wohlergehens all unserer Mitarbeiter und unserer Anteilseigner.</p><h4>11. Dauer, für die die personenbezogenen Daten gespeichert werden</h4><p>Das Kriterium für die Dauer der Speicherung von personenbezogenen Daten ist die jeweilige gesetzliche Aufbewahrungsfrist. Nach Ablauf der Frist werden die entsprechenden Daten routinemäßig gelöscht, sofern sie nicht mehr zur Vertragserfüllung oder Vertragsanbahnung erforderlich sind.</p><h4>12. Gesetzliche oder vertragliche Vorschriften zur Bereitstellung der personenbezogenen Daten; Erforderlichkeit für den Vertragsabschluss; Verpflichtung der betroffenen Person, die personenbezogenen Daten bereitzustellen; mögliche Folgen der Nichtbereitstellung</h4><p>Wir klären Sie darüber auf, dass die Bereitstellung personenbezogener Daten zum Teil gesetzlich vorgeschrieben ist (z.B. Steuervorschriften) oder sich auch aus vertraglichen Regelungen (z.B. Angaben zum Vertragspartner) ergeben kann. Mitunter kann es zu einem Vertragsschluss erforderlich sein, dass eine betroffene Person uns personenbezogene Daten zur Verfügung stellt, die in der Folge durch uns verarbeitet werden müssen. Die betroffene Person ist beispielsweise verpflichtet uns personenbezogene Daten bereitzustellen, wenn unser Unternehmen mit ihr einen Vertrag abschließt. Eine Nichtbereitstellung der personenbezogenen Daten hätte zur Folge, dass der Vertrag mit dem Betroffenen nicht geschlossen werden könnte. Vor einer Bereitstellung personenbezogener Daten durch den Betroffenen muss sich der Betroffene an einen unserer Mitarbeiter wenden. Unser Mitarbeiter klärt den Betroffenen einzelfallbezogen darüber auf, ob die Bereitstellung der personenbezogenen Daten gesetzlich oder vertraglich vorgeschrieben oder für den Vertragsabschluss erforderlich ist, ob eine Verpflichtung besteht, die personenbezogenen Daten bereitzustellen, und welche Folgen die Nichtbereitstellung der personenbezogenen Daten hätte.</p><h4>13. Bestehen einer automatisierten Entscheidungsfindung</h4><p>Als verantwortungsbewusstes Unternehmen verzichten wir auf eine automatische Entscheidungsfindung oder ein Profiling.</p><p>Soweit Sie Ihre Einwilligung erklärt haben, wird auf dieser Website Google Analytics eingesetzt, ein Webanalysedienst der Google Ireland Limited („Google“). Die Nutzung umfasst die Betriebsart „Universal Analytics“. Hierdurch ist es möglich, Daten, Sitzungen und Interaktionen über mehrere Geräte hinweg einer pseudonymen User-ID zuzuordnen und so die Aktivitäten eines Nutzers geräteübergreifend zu analysieren.</p><p>Google Analytics verwendet sog. „Cookies“, Textdateien, die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie ermöglichen. Die durch das Cookie erzeugten Informationen über Ihre Benutzung dieser Website werden in der Regel an einen Server von Google in den USA übertragen und dort gespeichert. Im Falle der Aktivierung der IP-Anonymisierung auf dieser Website, wird Ihre IP-Adresse von Google jedoch innerhalb von Mitgliedstaaten der Europäischen Union oder in anderen Vertragsstaaten des Abkommens über den Europäischen Wirtschaftsraum zuvor gekürzt. Wir weisen Sie darauf hin, dass auf dieser Webseite Google Analytics um eine IP-Anonymisierung erweitert wurde, um eine anonymisierte Erfassung von IP-Adressen (sog. IP-Masking) zu gewährleisten. Die im Rahmen von Google Analytics von Ihrem Browser übermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengeführt. Nähere Informationen zu Nutzungsbedingungen und Datenschutz finden Sie unter <a href=\"https://www.google.com/analytics/terms/de.html\">https://www.google.com/analytics/terms/de.html</a> bzw. unter <a href=\"https://policies.google.com/?hl=de\">https://policies.google.com/?hl=de</a>.</p><p><strong>Zwecke der Verarbeitung</strong><br>Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports über die Websiteaktivitäten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegenüber dem Websitebetreiber zu erbringen.</p><p><strong>Rechtsgrundlage</strong><br>Die Rechtsgrundlage für den Einsatz von Google Analytics ist Ihre Einwilligung gemäß <a href=\"https://dsgvo-gesetz.de/art-6-dsgvo/\">Art. 6 Abs. 1 S.1 lit. a DSGVO</a>.</p><p><strong>Empfänger / Kategorien von Empfängern</strong><br>Der Empfänger der erhobenen Daten ist Google.</p><p><strong>Übermittlung in Drittstaaten</strong><br>Die personenbezogenen Daten werden unter dem EU-US Privacy Shield auf Grundlage des Angemessenheitsbeschlusses der Europäischen Kommission in die USA übermittelt. Das Zertifikat können Sie <a href=\"https://www.privacyshield.gov/participant?id=a2zt000000001L5AAI\">hier</a> abrufen.</p><p><strong>Dauer der Datenspeicherung</strong><br>Die von uns gesendeten und mit Cookies, Nutzerkennungen (z. B. User-ID) oder Werbe-IDs verknüpften Daten werden nach 14 Monaten automatisch gelöscht. Die Löschung von Daten, deren Aufbewahrungsdauer erreicht ist, erfolgt automatisch einmal im Monat.</p><p><strong>Betroffenenrechte</strong><br>Sie können Ihre Einwilligung jederzeit mit Wirkung für die Zukunft widerrufen, indem Sie die Speicherung der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht sämtliche Funktionen dieser Website vollumfänglich werden nutzen können.</p><p>Sie können darüber hinaus die Erfassung der durch das Cookie erzeugten und auf Ihre Nutzung der Website bezogenen Daten (inkl. Ihrer IP-Adresse) an Google sowie die Verarbeitung dieser Daten durch Google verhindern, indem Sie das <a href=\"https://tools.google.com/dlpage/gaoptout?hl=de\">Browser-Add-on</a> herunterladen und installieren. Opt-Out-Cookies verhindern die zukünftige Erfassung Ihrer Daten beim Besuch dieser Website. Um die Erfassung durch Universal Analytics über verschiedene Geräte hinweg zu verhindern, müssen Sie das Opt-Out auf allen genutzten Systemen durchführen. Wenn Sie hier klicken, wird das Opt-Out-Cookie gesetzt: <a href=\"javascript:gaOptout()\"><strong>Google Analytics deaktivieren</strong></a></p>'),
	(13,1,'Data Protection','<p>Thank you for your interest in our company. Data protection is of a particularly high priority for the operators of this website. In principle, this website can be used without providing any personal data. However, if a data subject wishes to make use of our company\'s special services via our website, processing of personal data may be necessary. If the processing of personal data is necessary and there is no legal basis for such processing, we generally obtain the consent of the person concerned.</p><p>The processing of personal data, for example the name, address, e-mail address or telephone number of a person concerned, is always carried out in accordance with the General Data Protection Regulation and in accordance with the country-specific data protection regulations applicable to ifindilu.com. By means of this data protection declaration, our company would like to inform the public about the type, scope and purpose of the personal data we collect, use and process. Furthermore, data subjects are informed about their rights by means of this data protection declaration.</p><p>As the controller, ifindilu.com has implemented numerous technical and organizational measures to ensure the most complete protection of personal data processed through this website. Nevertheless, internet-based data transmissions can generally have security gaps, so that absolute protection cannot be guaranteed. For this reason, every person concerned is free to transmit personal data to us in alternative ways, for example by telephone.</p><h4>1. Definitions</h4><p>The data protection declaration of the company ifindilu.com is based on the terms used by the European directive and regulation giver when the General Data Protection Regulation (GDPR) was adopted. Our data protection declaration should be easy to read and understand for the public as well as for our customers and business partners. To ensure this, we would like to explain the terminology used in advance.</p><p>We use the following terms in this data protection declaration:</p><h4>a) personal data</h4><p>Personal data is all information that relates to an identified or identifiable natural person (hereinafter \"data subject\"). A natural person is regarded as identifiable who, directly or indirectly, in particular by means of assignment to an identifier such as a name, an identification number, location data, an online identifier or one or more special features that express the physical, physiological, genetic, psychological, economic, cultural or social identity of this natural person can be identified.</p><h4>b) data subject</h4><p>The data subject is any identified or identifiable natural person whose personal data is processed by the person responsible for processing.</p><h4>c) Processing</h4><p>Processing is any process carried out with or without the help of automated procedures or any such series of processes in connection with personal data such as the collection, recording, organization, ordering, storage, adaptation or change, reading, querying, use, Disclosure through transmission, distribution or any other form of provision, comparison or linking, restriction, deletion or destruction.</p><h4>d) Restriction of processing</h4><p>Restriction of processing is the marking of stored personal data with the aim of restricting their future processing.</p><h4>e) Profiling</h4><p>Profiling is any type of automated processing of personal data that consists of using this personal data to evaluate certain personal aspects relating to a natural person, in particular aspects relating to work performance, economic situation, health, personal To analyze or predict the preferences, interests, reliability, behavior, whereabouts or relocation of this natural person.</p><h4>f) pseudonymization</h4><p>Pseudonymization is the processing of personal data in a way in which the personal data can no longer be assigned to a specific data subject without the use of additional information, provided that this additional information is stored separately and is subject to technical and organizational measures that ensure that the personal data cannot be assigned to an identified or identifiable natural person.</p><h4>g) Controller or controller</h4><p>The person responsible or the person responsible for the processing is the natural or legal person, authority, institution or other body that alone or jointly with others decides on the purposes and means of processing personal data. If the purposes and means of this processing are specified by Union law or the law of the member states, the person responsible or the specific criteria for his appointment can be provided for in accordance with Union law or the law of the member states.</p><h4>h) Processors</h4><p>Processor is a natural or legal person, authority, institution or other body that processes personal data on behalf of the person responsible.</p><h4>i) Recipient</h4><p>Recipient is a natural or legal person, authority, institution or other body to which personal data is disclosed, regardless of whether it is a third party or not. However, authorities that may receive personal data as part of a specific investigation under Union law or the law of the member states are not considered recipients.</p><h4>j) third party</h4><p>A third party is a natural or legal person, public authority, agency or body other than the data subject, the person responsible, the processor and the persons who are authorized to process the personal data under the direct responsibility of the person responsible or the processor.</p><h4>k) Consent</h4><p>Consent is any declaration of intent voluntarily given by the data subject in an informed manner and unequivocally in the form of a declaration or other unequivocal affirmative action with which the data subject indicates that they consent to the processing of their personal data is.</p><h4>2. Name and address of the person responsible for processing</h4><p>The person responsible within the meaning of the General Data Protection Regulation, other data protection laws applicable in the member states of the European Union and other provisions of a data protection nature is:</p><p>Kirill Kramer</p><p>Liebigstrasse 15</p><p>74074 Heilbronn</p><p>Germany</p><p>Email: <a href=\"https://www.ifindilu.com/mailto:info@ifindilu.com\">info@ifindilu.com</a></p><p>Website: www.ifindilu.com</p><h4>3. Cookies</h4><p>The internet pages of the company ifindilu.com use cookies. Cookies are text files that are stored and stored on a computer system via an internet browser.</p><p>Numerous websites and servers use cookies. Many cookies contain a so-called cookie ID. A cookie ID is a unique identifier for the cookie. It consists of a string of characters through which websites and servers can be assigned to the specific Internet browser in which the cookie was stored. This enables the websites and servers visited to distinguish the individual browser of the person concerned from other Internet browsers that contain other cookies. A specific internet browser can be recognized and identified via the unique cookie ID.</p><p>By using cookies, the company ifindilu.com can provide the users of this website with more user-friendly services that would not be possible without the cookie setting.</p><p>Using a cookie, the information and offers on our website can be optimized in the interests of the user. As already mentioned, cookies enable us to recognize the users of our website. The purpose of this recognition is to make it easier for users to use our website. For example, the user of a website that uses cookies does not have to re-enter their access data every time they visit the website, because this is done by the website and the cookie stored on the user\'s computer system. Another example is the cookie of a shopping cart in the online shop. The online shop uses a cookie to remember the items that a customer has placed in the virtual shopping cart.</p><p>The person concerned can prevent the setting of cookies by our website at any time by means of a corresponding setting in the Internet browser used and thus permanently object to the setting of cookies. Furthermore, cookies that have already been set can be deleted at any time via an Internet browser or other software programs. This is possible in all common internet browsers. If the person concerned deactivates the setting of cookies in the internet browser used, not all functions of our website may be fully usable.</p><h4>4. Collection of general data and information</h4><p>The website of the company ifindilu.com collects a series of general data and information each time the website is accessed by a data subject or an automated system. These general data and information are stored in the server\'s log files. The (1) browser types and versions used, (2) the operating system used by the accessing system, (3) the website from which an accessing system reaches our website (so-called referrer), (4) the sub-websites that are accessed via an accessing system on our website can be controlled, (5) the date and time of access to the website, (6) an internet protocol address (IP address),</p><p>When using these general data and information, ifindilu.com does not draw any conclusions about the person concerned. Rather, this information is required to (1) correctly deliver the content of our website, (2) optimize the content of our website and the advertising for it, (3) ensure the long-term functionality of our information technology systems and the technology of our website and ( 4) to provide law enforcement authorities with the information necessary for law enforcement in the event of a cyber attack. This anonymously collected data and information is therefore evaluated statistically by the company ifindilu.com on the one hand and with the aim of increasing data protection and data security in our company, in order to ultimately ensure an optimal level of protection for the personal data we process. The anonymous data in the server log files are stored separately from all personal data provided by a data subject.</p><h4>5. Routine deletion and blocking of personal data</h4><p>The person responsible for the processing processes and stores personal data of the data subject only for the period of time that is necessary to achieve the storage purpose or if this is specified by the European directives and regulations or another legislator in laws or regulations, which the person responsible for the processing is subject to, was provided.</p><p>If the purpose of storage no longer applies or if a storage period prescribed by the European directives and regulations or another responsible legislator expires, the personal data will be routinely blocked or deleted in accordance with the statutory provisions.</p><h4>6. Rights of the data subject</h4><h4>a) Right to confirmation</h4><p>Every person concerned has the right granted by the European directive and regulation giver to request confirmation from the person responsible for the processing as to whether personal data concerning them are being processed. If a person concerned wishes to exercise this right to confirmation, they can contact an employee of the person responsible for processing at any time.</p><h4>b) Right to information</h4><p>Every person affected by the processing of personal data has the right granted by the European legislator of directives and regulations to receive free information about the personal data stored about him and a copy of this information from the person responsible for the processing at any time. Furthermore, the European directives and regulations grant the data subject access to the following information:</p><ul><li>the purposes of processing</li><li>the categories of personal data that are processed</li><li>The recipients or categories of recipients to whom the personal data have been disclosed or are still being disclosed, in particular to recipients in third countries or to international organizations</li><li>if possible, the planned duration for which the personal data will be stored or, if this is not possible, the criteria for determining this duration</li><li>the existence of a right to correction or deletion of the personal data concerning you or to restriction of processing by the person responsible or a right to object to this processing</li><li>the existence of a right to lodge a complaint with a supervisory authority</li><li>if the personal data are not collected from the data subject: All available information on the origin of the data</li><li>the existence of automated decision-making including profiling in accordance with Article 22 (1) and (4) GDPR and - at least in these cases - meaningful information about the logic involved and the scope and intended effects of such processing for the data subject</li></ul><h4>c) Right to rectification</h4><p>Every person affected by the processing of personal data has the right granted by the European directives and regulations to request the immediate correction of incorrect personal data concerning them. Furthermore, the data subject has the right, taking into account the purposes of the processing, to request the completion of incomplete personal data - including by means of a supplementary declaration.</p><p>If a data subject wishes to exercise this right to rectification, they can contact an employee of the person responsible for processing at any time.</p><h4>d) Right to erasure (right to be forgotten)</h4><p>Every person affected by the processing of personal data has the right granted by the European legislator of directives and regulations to demand that the person responsible delete the personal data concerning them immediately, provided that one of the following reasons applies and insofar as the processing is not necessary:</p><ul><li>The personal data were collected or otherwise processed for purposes for which they are no longer necessary.</li><li>The data subject revokes their consent, on which the processing was based in accordance with Art. 6 Paragraph 1 Letter a GDPR or Art. 9 Paragraph 2 Letter a GDPR, and there is no other legal basis for the processing.</li><li>The data subject objects to the processing in accordance with Art. 21 Paragraph 1 GDPR, and there are no overriding legitimate reasons for the processing, or the data subject objects in accordance with Art. 21 Paragraph 2 GDPR to the Processing a.</li><li>The personal data was processed unlawfully.</li><li>The deletion of personal data is necessary to fulfill a legal obligation under Union law or the law of the member states to which the person responsible is subject.</li><li>The personal data was collected in relation to the information society services offered in accordance with Art. 8 Para. 1 GDPR.</li></ul><h4>e) Right to restriction of processing</h4><p>Any person affected by the processing of personal data has the right, granted by the European legislator of directives and regulations, to require the controller to restrict processing if one of the following conditions is met:</p><ul><li>The correctness of the personal data is contested by the data subject for a period that enables the person responsible to check the correctness of the personal data.</li><li>The processing is unlawful, the person concerned refuses to delete the personal data and instead requests that the use of the personal data be restricted.</li><li>The person responsible no longer needs the personal data for the purposes of processing, but the data subject needs them to assert, exercise or defend legal claims.</li><li>The person concerned has lodged an objection to the processing in accordance with Art. 21 Paragraph 1 GDPR and it has not yet been determined whether the legitimate reasons of the person responsible outweigh those of the person concerned.</li></ul><h4>f) Right to data portability</h4><p>Every person affected by the processing of personal data has the right granted by the European legislator of directives and regulations to receive the personal data concerning them, which have been made available to a responsible party by the person concerned, in a structured, common and machine-readable format. You also have the right to transfer this data to another person responsible without hindrance from the person responsible to whom the personal data was provided, provided that the processing is based on the consent pursuant to Art. 6 Para. 1 Letter a GDPR or Art. 9 Para . 2 letter a GDPR or on a contract according to Art. 6 para.</p><p>Furthermore, when exercising their right to data portability in accordance with Art. 20 (1) GDPR, the person concerned has the right to have the personal data transmitted directly from one person responsible to another, insofar as this is technically feasible and if this does not affect the rights and freedoms of other persons.</p><p>To assert the right to data portability, the person concerned can contact an employee of ifindilu.com at any time.</p><h4>g) Right to object</h4><p>Any person affected by the processing of personal data has the right granted by the European legislator of directives and regulations to object at any time to the processing of personal data relating to them, which is based on Art. 6 Paragraph 1 Letter e or f DS-GVO takes place to object. This also applies to profiling based on these provisions.</p><p>Ifindilu.com no longer processes the personal data in the event of an objection, unless we can prove compelling legitimate reasons for the processing that outweigh the interests, rights and freedoms of the data subject, or the processing serves to assert, exercise or defense of legal claims.</p><p>If the company ifindilu.com processes personal data in order to operate direct mail, the data subject has the right to object at any time to the processing of personal data for the purpose of such advertising. This also applies to profiling insofar as it is associated with such direct advertising. If the data subject objects to ifindilu.com processing for direct marketing purposes, ifindilu.com will no longer process the personal data for these purposes.</p><p>In addition, the data subject has the right, for reasons arising from their particular situation, to object to the processing of personal data concerning them that is carried out by ifindilu.com for scientific or historical research purposes or for statistical purposes in accordance with Art. 89 Para. 1 DS-GVO to object, unless such processing is necessary to fulfill a task in the public interest.</p><p>To exercise the right to object, the person concerned can contact any employee of ifindilu.com or another employee directly. The data subject is also free, in connection with the use of information society services, regardless of Directive 2002/58 / EC, to exercise their right of objection by means of automated procedures in which technical specifications are used.</p><h4>h) Automated decisions in individual cases including profiling</h4><p>Any person affected by the processing of personal data has the right granted by the European legislator of directives and regulations not to be subjected to a decision based solely on automated processing - including profiling - which has legal effects on them or similarly significantly affects them, if the decision (1) is not necessary for the conclusion or performance of a contract between the data subject and the person responsible, or (2) based on legal provisions of the Union or of the member states to which the person responsible is subject,is permissible and these legal provisions contain appropriate measures to safeguard the rights and freedoms as well as the legitimate interests of the data subject or (3) with the express consent of the data subject</p><p>If the decision (1) is necessary for the conclusion or fulfillment of a contract between the data subject and the person responsible or (2) it is made with the express consent of the data subject, ifindilu.com takes appropriate measures to safeguard the rights and freedoms as well To protect the legitimate interests of the data subject, including at least the right to obtain intervention by a person on the part of the person responsible, to express his or her own point of view and to contest the decision.</p><p>If the data subject wishes to assert rights with regard to automated decisions, they can contact an employee of the person responsible for processing at any time.</p><h4>i) Right to withdraw consent under data protection law</h4><p>Every person affected by the processing of personal data has the right granted by the European legislator of directives and regulations to revoke their consent to the processing of personal data at any time.</p><p>If the person concerned wishes to assert their right to withdraw consent, they can contact an employee of the person responsible for processing at any time.</p><h4>7. Data protection provisions on the application and use of affilinet</h4><p>The person responsible for processing has integrated components of the affilinet company on this website. Affilinet is a German affiliate network that offers affiliate marketing.</p><p>Affiliate marketing is an Internet-supported form of sales that enables commercial operators of Internet sites, the so-called merchants or advertisers, to advertise, which is usually remunerated through click or sale commissions, on third-party websites, i.e. with sales partners who are also affiliates or publishers are to be shown. The merchant provides an advertising medium via the affiliate network, i.e. an advertising banner or other suitable means of internet advertising, which is then integrated by an affiliate on its own website or via other channels, such as keyword advertising or e-mail -Marketing, advertised.</p><p>Affilinet is operated by affilinet GmbH, Sapporobogen 6-8, 80637 Munich, Germany.</p><p>Affilinet places a cookie on the information technology system of the person concerned. What cookies are has already been explained above. Affilinet\'s tracking cookie does not store any personal data. Only the identification number of the affiliate, i.e. the partner who mediates the potential customer, as well as the order number of the visitor to a website and the clicked advertising material are stored. The purpose of storing this data is to process commission payments between a merchant and the affiliate, which are processed via the affiliate network, i.e. Affilinet.</p><p>The person concerned can prevent the setting of cookies by our website, as already shown above, at any time by means of a corresponding setting of the Internet browser used and thus permanently object to the setting of cookies. Such a setting of the internet browser used would also prevent Affilinet from setting a cookie on the information technology system of the person concerned. In addition, cookies already set by Affilinet can be deleted at any time via an Internet browser or other software programs.</p><p>Affilinet\'s current data protection regulations can be found at https://www.affili.net/de/footeritem/datenschutz.</p><h4>8. Data protection provisions on the application and use of functions of the Amazon partner program</h4><p>As a participant in the Amazon partner program, the controller has integrated Amazon components on this website. The Amazon components were designed by Amazon with the aim of providing customers with advertisements on different websites of the Amazon group, in particular on Amazon.co.uk, Local.Amazon.co.uk, Amazon.de, BuyVIP.com, Amazon.fr , Amazon.it and Amazon.es. To broker BuyVIP.com against payment of a commission. The person responsible for processing can generate advertising income by using the Amazon components.</p><p>The operating company of these Amazon components is Amazon EU S.à.rl, 5 Rue Plaetis, L-2338 Luxembourg, Luxembourg.</p><p>Amazon places a cookie on the information technology system of the person concerned. What cookies are has already been explained above. Each time one of the individual pages of this website is called up, which is operated by the person responsible for processing and on which an Amazon component has been integrated, the Internet browser on the information technology system of the person concerned is automatically prompted by the respective Amazon component to transfer data to To transmit the purposes of online advertising and billing of commissions to Amazon. As part of this technical process, Amazon gains knowledge of personal data that Amazon uses to trace the origin of orders received by Amazon and subsequently to enable commission accounting.</p><p>The person concerned can prevent the setting of cookies by our website, as already shown above, at any time by means of a corresponding setting of the Internet browser used and thus permanently object to the setting of cookies. Such a setting of the internet browser used would also prevent Amazon from setting a cookie on the information technology system of the person concerned. In addition, cookies already set by Amazon can be deleted at any time via an Internet browser or other software programs.</p><p>Further information and the applicable data protection provisions of Amazon can be found at https://www.amazon.de/gp/help/customer/display.html?nodeId=3312401.</p><h4>9. Legal basis for processing</h4><p>Art. 6 I lit. a GDPR serves our company as the legal basis for processing operations for which we obtain consent for a specific processing purpose. If the processing of personal data is necessary to fulfill a contract to which the data subject is a party, as is the case, for example, with processing operations that are necessary for the delivery of goods or the provision of other services or consideration, the processing is based on Art. 6 I lit. b GDPR. The same applies to such processing operations that are necessary to carry out pre-contractual measures, for example in cases of inquiries about our products or services. If our company is subject to a legal obligation which requires the processing of personal data, for example to fulfill tax obligations, the processing is based on Art. 6 I lit. c GDPR. In rare cases, it may be necessary to process personal data in order to protect the vital interests of the data subject or another natural person. This would be the case, for example, if a visitor to our company were injured and his name, age, health insurance data or other vital information would have to be passed on to a doctor, hospital or other third party. Then the processing would be based on Art. 6 I lit. d GDPR. Ultimately, processing operations could be based on Art. 6 I lit. f GDPR. Processing operations that are not covered by any of the aforementioned legal bases are based on this legal basis if the processing is necessary to safeguard a legitimate interest of our company or a third party, provided that the interests, fundamental rights and freedoms of the person concerned do not prevail. We are particularly permitted to carry out such processing operations because they have been specifically mentioned by the European legislator. In this respect, he took the view that a legitimate interest could be assumed if the person concerned is a customer of the person responsible (recital 47 sentence 2 GDPR). Processing operations that are not covered by any of the aforementioned legal bases are based on this legal basis if the processing is necessary to safeguard a legitimate interest of our company or a third party, provided that the interests, fundamental rights and freedoms of the person concerned do not prevail. We are particularly permitted to carry out such processing operations because they have been specifically mentioned by the European legislator. In this respect, he took the view that a legitimate interest could be assumed if the person concerned is a customer of the person responsible (recital 47 sentence 2 GDPR). Processing operations that are not covered by any of the aforementioned legal bases are based on this legal basis if the processing is necessary to safeguard a legitimate interest of our company or a third party, provided that the interests, fundamental rights and freedoms of the person concerned do not prevail. We are particularly permitted to carry out such processing operations because they have been specifically mentioned by the European legislator. In this respect, he took the view that a legitimate interest could be assumed if the person concerned is a customer of the person responsible (recital 47 sentence 2 GDPR). if the processing is necessary to safeguard a legitimate interest of our company or a third party, provided that the interests, fundamental rights and freedoms of the person concerned do not outweigh them. We are particularly permitted to carry out such processing operations because they have been specifically mentioned by the European legislator. In this respect, he took the view that a legitimate interest could be assumed if the person concerned is a customer of the person responsible (recital 47 sentence 2 GDPR). if the processing is necessary to safeguard a legitimate interest of our company or a third party, provided that the interests, fundamental rights and freedoms of the person concerned do not outweigh them. We are particularly permitted to carry out such processing operations because they have been specifically mentioned by the European legislator. In this respect, he took the view that a legitimate interest could be assumed if the person concerned is a customer of the person responsible (recital 47 sentence 2 GDPR).</p><h4>10. Legitimate interests in processing that are being pursued by the controller or a third party</h4><p>If the processing of personal data is based on Article 6 I lit.f GDPR, our legitimate interest is the conduct of our business activities for the benefit of all our employees and our shareholders.</p><h4>11. Duration for which the personal data will be stored</h4><p>The criterion for the duration of the storage of personal data is the respective statutory retention period. After the deadline, the corresponding data will be routinely deleted, provided that they are no longer required to fulfill or initiate a contract.</p><h4>12. Legal or contractual provisions for the provision of personal data; Necessity for the conclusion of the contract; Obligation of the data subject to provide the personal data; possible consequences of non-provision</h4><p>We explain to you that the provision of personal data is in part required by law (e.g. tax regulations) or can also result from contractual regulations (e.g. information on the contractual partner). In order to conclude a contract, it may sometimes be necessary for a data subject to provide us with personal data that we subsequently have to process. For example, the data subject is obliged to provide us with personal data when our company concludes a contract with them. Failure to provide personal data would mean that the contract could not be concluded with the person concerned. Before the person concerned provides personal data, the person concerned must contact one of our employees. Our employee explains to the person concerned on a case-by-case basis whether the provision of the personal data is required by law or contract or is necessary for the conclusion of the contract, whether there is an obligation to provide the personal data and what consequences the failure to provide the personal data would have.</p><h4>13. Existence of automated decision-making</h4><p>As a responsible company, we do not use automatic decision-making or profiling.</p><p>If you have given your consent, Google Analytics, a web analysis service provided by Google Ireland Limited (“Google”), is used on this website. Use includes the \"Universal Analytics\" operating mode. This makes it possible to assign data, sessions and interactions across multiple devices to a pseudonymous user ID and thus to analyze the activities of a user across devices.</p><p>Google Analytics uses so-called \"cookies\", text files that are stored on your computer and that enable your use of the website to be analyzed. The information generated by the cookie about your use of this website is usually transferred to a Google server in the USA and stored there. If IP anonymization is activated on this website, your IP address will be shortened beforehand by Google within member states of the European Union or in other contracting states of the Agreement on the European Economic Area. We would like to point out that Google Analytics has been expanded to include IP anonymization on this website in order to ensure the anonymized collection of IP addresses (so-called IP masking). The IP address transmitted by your browser as part of Google Analytics will not be merged with other Google data. For more information on terms of use and data protection, see <a href=\"https://www.google.com/analytics/terms/de.html\">https://www.google.com/analytics/terms/de.html</a> or at <a href=\"https://policies.google.com/?hl=de\">https://policies.google.com/?hl=de</a> .</p><p><strong>Purposes of processing</strong><br>On behalf of the operator of this website, Google will use this information to evaluate your use of the website, to compile reports on website activity and to provide the website operator with other services relating to website activity and internet usage.</p><p><strong>Legal basis</strong><br>The legal basis for the use of Google Analytics is your consent in accordance with <a href=\"https://dsgvo-gesetz.de/art-6-dsgvo/\">Article 6, Paragraph 1, Sentence 1, Letter a of the GDPR</a> .</p><p><strong>Recipients / categories of recipients</strong><br>The recipient of the data collected is Google.</p><p><strong>Transfer to third countries</strong><br>The personal data is transferred to the USA under the EU-US Privacy Shield on the basis of the adequacy decision of the European Commission. You <a href=\"https://www.privacyshield.gov/participant?id=a2zt000000001L5AAI\">can</a> access the certificate <a href=\"https://www.privacyshield.gov/participant?id=a2zt000000001L5AAI\">here</a> .</p><p><strong>Duration of data storage</strong><br>The <strong>data</strong> sent by us and linked to cookies, user IDs (e.g. user ID) or advertising IDs are automatically deleted after 14 months. The deletion of data whose retention period has expired takes place automatically once a month.</p><p><strong>Rights of data subjects</strong><br>You can revoke your consent at any time with effect for the future by preventing the storage of cookies by setting your browser software accordingly; however, we would like to point out that in this case you may not be able to use all functions of this website to their full extent.</p><p>You can also prevent Google from collecting the data generated by the cookie and relating to your use of the website (including your IP address) and from processing this data by downloading and installing the <a href=\"https://tools.google.com/dlpage/gaoptout?hl=de\">browser add-on</a> . Opt-out cookies prevent the future collection of your data when you visit this website. In order to prevent the collection by Universal Analytics across different devices, you have to carry out the opt-out on all systems used. If you click here, the opt-out cookie will be set: <a href=\"javascript:gaOptout()\"><strong>Deactivate Google Analytics</strong></a></p>'),
	(14,1,'Imprint','<p>According to § 5 TMG</p><p>Kirill Kramer<br>Liebigstrase 15<br>74074 Heilbronn, Germany<br>&nbsp;</p><p><strong>Represented by:</strong><br>Kirill Kramer<br>&nbsp;</p><p><strong>Contact:</strong><br><br>Email: <a href=\"https://www.ifindilu.com/mailto:info@ifindilu.com\">info@ifindilu.com</a><br>&nbsp;</p><p><strong>Sales tax ID: DE328373319</strong><br>Sales tax identification number according to §27a Sales Tax Law:<br>&nbsp;</p><p><strong>Disclaimer:</strong><br><br><strong>liability for content</strong><br><br>The contents of our pages were created with great care. However, we cannot accept any liability for the correctness, completeness and topicality of the content. As a service provider, we are responsible for our own content on these pages in accordance with general law in accordance with Section 7 (1) TMG. According to §§ 8 to 10 TMG, as a service provider, we are not obliged to monitor transmitted or stored third-party information or to research circumstances that indicate illegal activity. Obligations to remove or block the use of information according to general laws remain unaffected. However, liability in this regard is only possible from the point in time at which we become aware of a specific legal violation. As soon as we become aware of such legal violations, we will remove this content immediately.<br><br><strong>Liability for links</strong><br><br>Our offer contains links to external third-party websites over whose content we have no influence. Therefore, we cannot accept any liability for this third-party content. The respective provider or operator of the pages is always responsible for the content of the linked pages. The linked pages were checked for possible legal violations at the time they were linked. No illegal content was found at the time the link was created. A permanent control of the content of the linked pages is not reasonable without concrete evidence of a violation of the law.<br><br><strong>copyright</strong><br><br>The content and works on these pages created by the website operator are subject to German copyright law. The duplication, processing, distribution and any kind of exploitation outside the limits of copyright law require the written consent of the respective author or creator. Downloads and copies of this website are only permitted for private, non-commercial use. As far as the content on this site was not created by the operator, the copyrights of third parties are observed. In particular contents of third parties are marked as such. Should you nevertheless become aware of a copyright infringement, we would ask you to notify us accordingly. If we become aware of legal violations, we will remove such content immediately.<br><br><strong>Data protection</strong><br><br>As a rule, our website can be used without providing personal data. Insofar as personal data (e.g. name, address or email address) is collected on our website, this is always done on a voluntary basis as far as possible. These data will not be passed on to third parties without your express consent.<br>We would like to point out that data transmission over the Internet (e.g. when communicating by e-mail) can have security gaps. A complete protection of the data against access by third parties is not possible.<br>We hereby expressly object to the use of the contact data published in the context of the imprint obligation by third parties to send advertising and information materials that have not been expressly requested. The operators of the pages expressly reserve the right to take legal action in the event of unsolicited sending of advertising information, such as spam mail.<br><br><br><strong>Google Analytics</strong><br><br>This website uses Google Analytics, a web analysis service provided by Google Inc. (\'\' Google \'\'). Google Analytics uses so-called “cookies”, text files that are stored on your computer and that enable an analysis of your use of the website. The information generated by the cookie about your use of this website (including your IP address) is transmitted to and stored by Google on servers in the United States. Google will use this information to evaluate your use of the website, to compile reports on website activity for website operators and to provide other services relating to website activity and internet usage. Google may also transfer this information to third parties if this is required by law or if third parties process this data on behalf of Google. Under no circumstances will Google associate your IP address with other Google data. You can prevent the installation of cookies by setting your browser software accordingly; however, we would like to point out that in this case you may not be able to use all functions of this website to their full extent. By using this website, you declare that you consent to the processing of the data collected about you by Google in the manner described above and for the purpose set out above.<br><br><strong>Google AdSense</strong><br><br>This website uses Google Adsense, a web advertising service provided by Google Inc., USA (\'\' Google \'\'). Google Adsense uses so-called “cookies” (text files) that are stored on your computer and that allow an analysis of your use of the website. Google Adsense also uses so-called \'\' Web Beacons \'\' (small invisible graphics) to collect information. By using the web beacon, simple actions such as visitor traffic on the website can be recorded and collected. The information generated by the cookie and / or web beacon about your use of this website (including your IP address) is transmitted to and stored by Google on servers in the United States. Google will use this information to evaluate your use of the website with regard to the advertisements, to compile reports on website activity and advertisements for the website operator and to provide other services relating to website activity and internet usage. Google may also transfer this information to third parties if necessary, if required by law or if third parties process this data on behalf of Google. Under no circumstances will Google associate your IP address with other Google data. You can prevent the storage of cookies on your hard drive and the display of web beacons by selecting `` do not accept cookies \'\' in your browser settings (in MS Internet Explorer under `` Tools&gt; Internet Options&gt; Data Protection&gt; Settings \'\' ; in Firefox under \'\' Extras&gt; Settings&gt; Data protection&gt; Cookies \'\'); however, we would like to point out that in this case you may not be able to use all functions of this website to their full extent. By using this website, you declare that you consent to the processing of the data collected about you by Google in the manner described above and for the purpose set out above.</p>');
